member.remarks:
If  is True, this method writes the schema for Json that contains command tag.
Example:
{
    "alter" : {
        "object" : { ... },
        "table" : { ... }
    }
}
If  is False, this method writes the schema for Json that contains command parameters.
Example:
{
    "object" : { ... },
    "table" : { ... }
}

member.example:
Example of valid input JSON command:
{
    "alter" : {
        "object" : {
            "database" : "tmtestdb"
        },
        "database" : {
            "name" : "tmtestdb",
            "description" : "sample database",
        }
    }
}

member.remarks:
This class is used to discover the object tree structure from the JSON document,
where the discovery of the state of individual objects is the responsibility of the caller of this class.

The object tree can be either a full Model tree or spanning tree with adornments.

As an example, we use it to read object translations collection from JSON.
ObjectTranslations can be associated with any metadata object that has Name or Description.
User can decide to translate a column X but not parent table Y. For this reason, we say that ObjectTranslations 
is a "sparse" collection, in a sense that ObjectTranslations objects are randomly attached to metadata objects from Model tree
and do not form parent-child hierarchy between themselves.
ObjectTranslations are represented in JSON as spanning tree over translated nodes of Model tree.
Here is the example of JSON:
    {
        "model": {
            "name": "Awesome Model",
            "translatedCaption": "Awesome model : Изумительная модель",
            "tables": [
                {
                    "name": "Customer",
                    "columns": [
                        {
                            "name": "Account Number",
                            "translatedCaption": "Account Number : номер счета",
                            "translatedDescription": "Account Number column. : Колонка для номера счета"
                        }
                    ]
                },
                {
                    "name": "Sales",
                    "measures": [
                        {
                            "name": "Profit Margin",
                            "kpi": {
                                "translatedDescription": "Simple KPI : простой ключевой показатель эффективности"
                            }
                        }
                    ]
                }
            ]
        }
    }

Model, tables Customer and Sales with column Account Number, measure Profit Margin and KPI in this picture are objects from main Model tree which are being translated.
"translatedCaption" and "translatedDescription" are additional properties (adornments to the object tree) which define how Name and Description are being translated.

JsonObjectTreeReader allows to iterate through the object tree from that JSON document, and take some actions on every node of the object tree.
It is similar to Visitor pattern.

Here is how perspective may look in JSON:
  "perspectives": [
   {
        "name": "LimitedCustomerData",
        "tables": [
            {
                "name": "Customer",
                "columns": [
                    {
                      "name": "First Name"
                    },
                    {
                      "name": "Last Name"
                    }
                  ],
Immediately after deserialization, we get bunch of PerspectiveXxx objects that have names but don't have
cross-links path set. For example, PerspectiveColumn.ColumnID cross-link doesn't have path set, it was simply
not saved in JSON by design. So every perspective object has to reconstruct the path to master object
based on its place in hierarchy and names of other perspective objects.
For example, PerspectiveColumn "First Name" will need to set the ColumnID path to be : Table = "Customer", Column = "First Name".

Similar to PerspectiveTable object, TablePermission object will have the name of the table and needs to be resolved.
